import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

import { GetRestaurantsList } from "../../services/getRestaurantsList";

import Header from "../../components/Header";
import Search from "../../components/Search";
import CarrouselMenu from "../../components/carrouselMenu";
import HomeCard from "../../components/home_card";
import Footer from "../../components/footer";

import axios from "axios";

const Home = () => {
  const [RestaurantsCard, setRestaurantsCard] = useState([]);

  useEffect(async () => {
    const response = await GetRestaurantsList();
    setRestaurantsCard(response.data);
  }, []);
  /* console.log(RestaurantsCard); */

  const [setRestaurantList] = useState([]);

  const getList = (id) => {
    const URL = `http://ec2-18-216-57-107.us-east-2.compute.amazonaws.com/api/restaurant/`;
    axios
      .get(URL)
      .then((response) => {
        console.log(response.data.data);
        setRestaurantList(response.data.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    getList();
  }, []);

  return (
    <div>
      <Header />
      <Search getList={getList} />
      <CarrouselMenu />
      {RestaurantsCard.map((restaurant) => (
        <HomeCard data={restaurant} />
      ))}
      <HomeCard />
      <Footer />
    </div>
  );
};

export default Home;
